import React, { Component } from 'react';
import axios from 'axios';
import { Sidebar, InputItem, DropdownItem, Icon, Item, Logo, LogoText } from 'react-sidebar-ui'
import {
  Row, Col, Card, CardHeader, CardBody, FormGroup, Label, Form, Input, InputGroup, InputGroupAddon,
  InputGroupText, Button, Collapse, FormText, Dropdown, DropdownToggle, DropdownMenu, ListGroup, ListGroupItem,
  Modal, ModalBody, ModalFooter, ModalHeader
} from "reactstrap";

const url = (process.env.REACT_APP_DOMAIN) + ':' + (process.env.REACT_APP_PORT) + '/';

class TestsPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      testTitle: "",
      maxScore: "",
      questions:""
    };

    this.createTest = this.createTest.bind(this)
    this.cancel = this.cancel.bind(this)
  }

  componentDidMount() {
  }

  createTest() {
    alert("Kreiran")
  }

  cancel() {
    this.setState({ openModal: false })
  }

  render() {
    return (
      <div>
        <Label>Title</Label>
        <Input type="text" placeholder="Username" autoComplete="username" value={this.state.username}
                       onChange={event => this.setState({username: event.target.value})}
                       onBlur={this.validateUsername}/>        
        <Button style={{ backgroundColor: "lightgreen", marginLeft: "10px" }} onClick={() => this.createTest()}>
          Create
        </Button>
        <Button style={{ backgroundColor: "lightred", marginLeft: "10px" }} onClick={() => this.createTest()}>
          Create
        </Button>
      </div>
    );
  }
}

export default TestsPage;
